selector_to_html = {"a[href=\"#parameter-effects-on-via-cluster-level-trajectory-graph\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>Parameter Effects on VIA cluster-level trajectory graph</strong><a class=\"headerlink\" href=\"#parameter-effects-on-via-cluster-level-trajectory-graph\" title=\"Permalink to this heading\">\uf0c1</a></h2><h3><strong>knn &amp; too_big_factor effects colored by cell type and pseudotime</strong><a class=\"headerlink\" href=\"#knn-too-big-factor-effects-colored-by-cell-type-and-pseudotime\" title=\"Permalink to this heading\">\uf0c1</a></h3>", "a[href=\"#input-parameters\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>Input Parameters</strong><a class=\"headerlink\" href=\"#input-parameters\" title=\"Permalink to this heading\">\uf0c1</a></h2>", "a[href=\"#id1\"]": "<table class=\"docutils align-default\" id=\"id1\">\n<caption><span class=\"caption-text\">Attributes</span><a class=\"headerlink\" href=\"#id1\" title=\"Permalink to this table\">\uf0c1</a></caption>\n<colgroup>\n<col style=\"width: 50%\"/>\n<col style=\"width: 50%\"/>\n</colgroup>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Attributes</p></th>\n<th class=\"head\"><p>Description</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>labels</p></td>\n<td><p>(list) length n_samples of corresponding cluster labels</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>single_cell_pt_markov</p></td>\n<td><p>(list) computed pseudotime</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>single_cell_bp</p></td>\n<td><p>(array) computed single cell branch probabilities (lineage likelihoods). n_cells x n_terminal states. The columns each correspond to a terminal state, in the same order presented in the\u2019terminal_clusters\u2019 attribute</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>terminal cluster</p></td>\n<td><p>(list) terminal clusters found by VIA</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>super_cluster_labels</p></td>\n<td><p>Set this to v0.labels (clustering output of first pass \u201cv0\u201d)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>super_terminal_cells</p></td>\n<td><p>super_terminal_cells = via.get_loc_terminal_states(v0, data)</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>full_neighbor_array</p></td>\n<td><p>full_neighbor_array = v0.full_neighbor_array. KNN graph from first pass of via - neighbor array</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>full_distance_array</p></td>\n<td><p>full_distance_array = v0.full_distance_array. KNN graph from first pass of via - edge weights</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>ig_full_graph</p></td>\n<td><p>ig_full_graph = v0.ig_full_graph igraph of the KNN graph from first pass of via</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>csr_array_locally_pruned</p></td>\n<td><p>csr_array_locally_pruned = v0.csr_array_locally_pruned. CSR matrix of the locally pruned KNN graph</p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"#parameters-and-attributes\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Parameters and Attributes<a class=\"headerlink\" href=\"#parameters-and-attributes\" title=\"Permalink to this heading\">\uf0c1</a></h1><h2><strong>Input Parameters</strong><a class=\"headerlink\" href=\"#input-parameters\" title=\"Permalink to this heading\">\uf0c1</a></h2>", "a[href=\"#jac-std-cluster-cluster-graph-pruning-std-effects\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>jac_std_cluster &amp; cluster_graph_pruning_std effects</strong><a class=\"headerlink\" href=\"#jac-std-cluster-cluster-graph-pruning-std-effects\" title=\"Permalink to this heading\">\uf0c1</a></h3>", "a[href=\"#attributes\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>Attributes</strong><a class=\"headerlink\" href=\"#attributes\" title=\"Permalink to this heading\">\uf0c1</a></h2>", "a[href=\"#knn-too-big-factor-effects-colored-by-cell-type-and-pseudotime\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>knn &amp; too_big_factor effects colored by cell type and pseudotime</strong><a class=\"headerlink\" href=\"#knn-too-big-factor-effects-colored-by-cell-type-and-pseudotime\" title=\"Permalink to this heading\">\uf0c1</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
